import React from "react";
import { Icon, Menu } from "semantic-ui-react";
import "../css/App.css";
import Resume from "../assets/Resume2018.pdf";

const color = ["grey"];

class Header extends React.Component {
  render() {
    return (
      <Menu
        stackable
        widths={8}
        style={{ padding: "0px", backroundcolor: "#141115" }}
      >
        <Menu.Item header as="h3" style={{ color: "white" }}>
          Timothy Bell
        </Menu.Item>
        <Menu.Item
          name="Home"
          href=""
          target="_blank"
          style={{ color: "white" }}
        />
        <Menu.Item
          name="Resume"
          href={Resume}
          target="_blank"
          style={{ color: "white" }}
        />
        <Menu.Item
          name="Github"
          href="https://github.com/unres"
          target="_blank"
          style={{ color: "white" }}
        />
        <Menu.Item
          name="LinkedIn"
          href="https://www.linkedin.com/in/timothy-bell97/"
          target="_blank"
          style={{ color: "white" }}
        />
        <Menu.Item
          name="Contact Me"
          position="right"
          style={{ color: "white" }}
        />
      </Menu>
    );
  }
}

export default Header;
